import React from 'react';

const Modal = ({ choose,setChoose }) => {

    const handleClick = (click) => {
        if(click.target.classList.contains('modal')){
            setChoose(false);
        }
    }

    return (
        <div className="modal" onClick={handleClick}>
            <img src={choose} />
        </div>
    )

}

export default Modal;
